<?php

namespace Southbay\Product\Console\Command;

use Magento\Store\Model\StoreManagerInterface;
use Southbay\Product\Api\Data\SouthbayProduct;
use Symfony\Component\Console\Command\Command;
use Symfony\Component\Console\Input\InputInterface;
use Symfony\Component\Console\Output\OutputInterface;

class FixVariantsProductsCommand extends Command
{
    protected function configure()
    {
        $this->setName('southbay:fix:variants:products')
            ->setDescription('Fix variants products');
    }

    protected function execute(InputInterface $input, OutputInterface $output)
    {
        $stores = [2, 4, 8, 10];

        $variants = $this->getVariants();

        foreach ($stores as $store_id) {
            $this->updateVariants($store_id, $variants[$store_id], $output);
        }

        return 1;
    }

    private function updateVariants($store_id, $variants, OutputInterface $output)
    {
        /**
         * @var \Magento\Framework\App\ObjectManager $objectManager
         */
        $objectManager = \Magento\Framework\App\ObjectManager::getInstance();
        /**
         * @var \Magento\Framework\App\State $state
         */
        $state = $objectManager->get('Magento\Framework\App\State');
        /**
         * @var StoreManagerInterface $storeManager
         */
        $storeManager = $objectManager->get(StoreManagerInterface::class);

        /**
         * @var \Magento\Catalog\Model\CategoryRepository $category_repository
         */
        $category_repository = $objectManager->get(\Magento\Catalog\Model\CategoryRepository::class);

        $productCollectionFactory = $objectManager->get('Magento\Catalog\Model\ResourceModel\Product\CollectionFactory');

        $store = $storeManager->getStore($store_id);
        $group = $store->getGroup();

        $catalog_root_id = $group->getRootCategoryId();
        $category = $category_repository->get($catalog_root_id);
        $subCategoryIds = $category->getChildrenCategories()->getAllIds();

        try {
            $state->setAreaCode('adminhtml');
        } catch (\Exception $e) {
        }

        /**
         * @var \Magento\Catalog\Model\ResourceModel\Product\Collection $product_collection
         */
        $product_collection = $productCollectionFactory->create();
        $product_collection->addCategoriesFilter(['in' => $subCategoryIds]);
        $product_collection->addFieldToFilter('type_id', ['in' => ['simple']]);
        $product_collection->setStoreId($store_id);
        $product_collection->load();

        $output->writeln("============================================================================================================");
        $output->writeln("Total products: " . $product_collection->count() . '. Store: ' . $store_id);

        $items = $product_collection->getItems();
        $total_update = 0;

        /**
         * @var \Magento\Catalog\Model\Product $item
         */
        foreach ($items as $item) {
            if (isset($variants[$item->getSku()])) {
                $variant = $variants[$item->getSku()];
                $current_variant = $item->getData(SouthbayProduct::ENTITY_SKU_VARIANT);
                if ($variant != $current_variant) {
                    $total_update++;
                    $item->setData(SouthbayProduct::ENTITY_SKU_VARIANT, $variants[$item->getSku()]);
                    $item->save();
                    $output->writeln("Update sku: " . $item->getSku() . '. store: ' . $store_id);
                }
            } else {
                $output->writeln("Variant not found for sku: " . $item->getSku() . '. store: ' . $store_id);
            }
        }

        $output->writeln("End store: " . $store_id . '. Total update:' . $total_update);
        $output->writeln("============================================================================================================");
    }

